import React from 'react';
import './styles/Home.css';
import space from '../images/Outer space-amico.png'

class Home extends React.Component {
    render() {
        return (
            <div className="Home">
                <h1>holaaa locas</h1>
                <img src={space} width='500'></img>
            </div>);
    }
}

export default Home;
